商品詳細<br>
■商品名<br>
『ちる…ぐでたまスリーパー(ネイビー)』SAZAC(サザック)<br>
■素材<br>
天竺(ポリエステル65%、綿35%)
<br>
■サイズ　<br>
男女兼用M<br>※身幅：51  /  着丈: 69cm<BR> 肩幅：45  /  袖丈：20  /   胸囲：88～96(約:cm) <BR>
男女兼用M<br>※身幅：53  /  着丈: 72cm<BR> 肩幅：47  /  袖丈：22  /   胸囲：96～104(約:cm) <BR><br>
大人気のぐでたまのTシャツです。<br>
アップリケが浮き上がっているかわいいデザイン★<br>
ゆったりとした着心地の男女兼用タイプ<br>
さらりとして涼やかな天竺生地を使用。<br>肌触りが良いのでパジャマにはもちろん、部屋着や普段使いにも！
<br>
